import React from 'react';
import { NavLink } from "react-router-dom";

const headerStyle ={
    backgroundColor: "#0D1F2D",
    width: "100%",
    color: "white", 
    paddingTop: '10px',
    paddingLeft: '10px'
}

const navStyle = {
    textAlign: "right",
    paddingBottom: "10px",
    paddingRight: "10px"
}

const linkStyles = {
    width: "100px",
    padding: "12px",
    margin: "0 6px 6px",
    color: "white",
    textDecoration: "none"
  };


function Header() {
    return (
        <header style={headerStyle}>
            <div id="logo" >
            <h1>DunderList</h1>
            </div>
            <div id="navBar" style={navStyle}>
                <NavLink exact to="/" style={linkStyles} activeStyle={{fontWeight: "bold",}}>Shop</NavLink>
                <NavLink to="/sell" style={linkStyles} activeStyle={{fontWeight: "bold",}}>Sell</NavLink>
                <NavLink to="/about" style={linkStyles} activeStyle={{fontWeight: "bold",}}>About</NavLink>
                <NavLink to="/cart" style={linkStyles} activeStyle={{fontWeight: "bold",}}>Cart</NavLink>
            </div>
        </header>
    )
}

export default Header
